import React, { useEffect, useState } from "react";

import Layout from "../components/Layout";
import Card from "../components/Card";
import { PopupWidget } from "react-calendly";
import { collection, addDoc,  getDocs} from "firebase/firestore";
import firedb from "../firebaseConfig";
import { fireProducts } from "../fireProducts";

function Home() {


  const [products, setProducts]=useState([]);
  useEffect(( )=> {
    getData()


  },[])







  async function addData() {

    try {
      await addDoc(collection(firedb, "users"), { name: "Safwan", age: "18" });


    } catch (error) {
      console.log(error);

    }
  }


  async function getData() {

    try {
      const users = await getDocs(collection(firedb, "products"),);
      const productsArray = [];
      users.forEach((doc) => {

        const obj = {
          id: doc.id, ...doc.data()
        };
        productsArray.push(obj);
      });


      console.log(productsArray);

    } catch (error) {
      console.log(error);

    }
  }










  return (


    <Layout>










      <div className="page-head">
        <div className="page-title">Home</div>


      </div>

      <div className="wrapper">
        <Card
          img='https://hub.chainreactioncycles.com/wp-content/uploads/2014/06/road.jpg'
          title=' Bicycle'
          description=' Hybride bicyle......'
          price='250'
        />

        <Card
          img='https://www.citybike.ee/files/t1/3495_61d6d707e65584.77810434_Croix.jpg'
          title=' Carnac Croix helmet road, 58-61, matte red'
          description=' Bicycle Cassete '
          price='50'
        />
        <Card
          img='https://www.citybike.ee/files/t1/6672_6056140cee43d3.68431472_XLCbrakepads.jpg'
          title=' XLC 955VC brake pads for V-brake'
          description=' Bicycle Cassete '
          price='7.50'
        />
        <Card
          img='https://www.citybike.ee/files/t1/3124_616aa77104f9f2.48625178_ShimanoDeoreBR-M6000.jpg'
          title=' Shimano Deore BR-M6000 front brake 750mm'
          description=' Complete brake (Br.lever + caliper + hose 750mm)'
          price='75'
        />

      </div>










      <button onClick={addData}> Add here</button>
      <button onClick={getData}> Get here</button>


      <PopupWidget
        url="https://calendly.com/aislamchy96/march-availity"

        rootElement={document.getElementById("root")}
        text="Book Your time !"
        textColor="#ffffff"
        color="#00a2ff"
      />







    </Layout>
  );
}

export default Home;
